pragma solidity ^0.5.8;

import "./mwadToken.sol";

contract mwadTokenSale {
    address payable admin;
    mwadToken public tokenContract;
    uint256 public tokenPrice;
    uint256 public tokensSold;

    event Sell(address _buyer, uint256 _amount);

    constructor(mwadToken _tokenContract, uint256 _tokenPrice) public {
        admin = msg.sender;
        tokenContract = _tokenContract;
        tokenPrice = _tokenPrice;
    }

    function multiply(uint x, uint y) internal pure returns (uint z) {
        require(y == 0 || (z = x * y) / y == x,"Error");
    }

    function buyTokens(uint256 _numberOfTokens) public payable {
        require(msg.value == multiply(_numberOfTokens, tokenPrice),"Error");
        require(tokenContract.balanceOf(address(this)) >= _numberOfTokens,"Error");
        require(tokenContract.transfer(msg.sender, _numberOfTokens),"Error");

        tokensSold += _numberOfTokens;

        emit Sell(msg.sender, _numberOfTokens);
    }

    function endSale() public {
        require(msg.sender == admin,"Error");
        require(tokenContract.transfer(admin, tokenContract.balanceOf(address(this))),"Error");

        admin.transfer(address(this).balance);
    }
}
